import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter container to be visible
    await page.waitForSelector('.price-filter', { state: 'visible' });

    // Locate and fill the minimum price input using a combination of class and placeholder
    const minPriceInput = page.locator('input.price-input[placeholder="Min"]');
    await minPriceInput.fill('50');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_min_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_min_price_filled.png'));

    // Locate and fill the maximum price input using its unique ID
    const maxPriceInput = page.locator('#maxPrice');
    await maxPriceInput.fill('200');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_max_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_max_price_filled.png'));

    // Locate and click the "Apply" button using a role-based selector
    const applyButton = page.getByRole('button', { name: 'Apply' });
    await applyButton.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_filter_applied.png'));

    // Extract the values from the input fields to verify the action
    const minPriceValue = await minPriceInput.inputValue();
    const maxPriceValue = await maxPriceInput.inputValue();

    return {
      success: true,
      action: "Successfully applied price range filter.",
      extractedData: {
        minPriceSet: minPriceValue,
        maxPriceSet: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
